import{_ as t,k as a,q as i,at as r}from"./chunks/framework.9Y72zqqA.js";const h=JSON.parse('{"title":"What is Protocol Launcher?","description":"","frontmatter":{"layout":"doc"},"headers":[],"relativePath":"guide/what-is-it.md","filePath":"en/guide/what-is-it.md"}'),o={name:"guide/what-is-it.md"};function n(s,e,l,p,d,c){return i(),a("div",null,[...e[0]||(e[0]=[r('<div style="display:none;" hidden="true" aria-hidden="true">Are you an LLM? You can read better optimized documentation at /protocol-launcher/guidewhat-is-it.md for this page in Markdown format</div><h1 id="what-is-protocol-launcher" tabindex="-1">What is Protocol Launcher? <a class="header-anchor" href="#what-is-protocol-launcher" aria-label="Permalink to “What is Protocol Launcher?”">​</a></h1><p><strong>Protocol Launcher</strong> is a TypeScript library designed to generate &quot;Quick Launch&quot; URLs (Deep Links) for various applications.</p><p>These URLs allow users to trigger specific actions in applications with a single click, such as installing plugins, configuring servers, or setting up API keys.</p><h2 id="key-features" tabindex="-1">Key Features <a class="header-anchor" href="#key-features" aria-label="Permalink to “Key Features”">​</a></h2><ul><li><strong>Type-Safe</strong>: Strict TypeScript types validate payloads and prevent malformed links.</li><li><strong>Multi-App Ready</strong>: Extensible design to support many apps via URL schemes.</li><li><strong>On-Demand / Tree-shakable</strong>: Import only what you need; small bundle footprint.</li><li><strong>Secure Encoding</strong>: Encodes configs safely to avoid injection. Supports Unicode characters including Chinese.</li><li><strong>Zero Runtime Dependencies</strong>: Lightweight library with no external runtime dependencies.</li><li><strong>ESM First</strong>: Modern ES Modules, works in Node and bundlers.</li></ul><h2 id="supported-applications" tabindex="-1">Supported Applications <a class="header-anchor" href="#supported-applications" aria-label="Permalink to “Supported Applications”">​</a></h2><p>Currently, we support the following applications:</p><ul><li><a href="./../apps/cherry-studio.html">Cherry Studio</a></li><li><a href="./../apps/cursor.html">Cursor</a></li></ul><p>More applications will be added in the future.</p>',10)])])}const g=t(o,[["render",n]]);export{h as __pageData,g as default};
